import React from "react";

import Grid from '@mui/material/Grid';




const Login = () => {
    return (
        <Grid container>
            <Grid item xs={12} textAlign='center'>
                <div className="login__header">
                    <h1>Welcome !!</h1>
                </div>
            </Grid>
        </Grid>
    );
}

export default Login;
